    return (
        // <div className="conatiner">
        <>
           

            <div className="card ">
                <img src="https://static.xx.fbcdn.net/rsrc.php/y8/r/dF5SId3UHWd.svg" alt="fb_name" className="fb-bg border-0 " width="200"/>
            <h2>Recent logins</h2>
            <p className="text-dark">Click your picture or add an account.</p>
            </div>
         
        </>
    )
}

export default LoggedinAccounts;
